import React from "react";
import { List, Header } from "semantic-ui-react";

export const Books = ({books}) => {
    return(
        <List>
            {books.map(book => {
                return(
                    <List.Item key={book.isbn}>
                        <Header>{book.isbn}</Header>
                    </List.Item>
                )
            })}
        </List>
    )
}
